import React from 'react';
import Title from './UI/Title/Title';
import Button, { ButtonBorderVariant, ButtonTextVariant } from './UI/Button/Button';


const UsefulButtons = () => {
    return (
        <div className='UsefulButtons'>
            <Title hType='h1'>полезные кнопки</Title>
            <div className="UsefulButtons__buttons">
                <Button
                    text="узнать больше"
                    // variantBorder={isHover ? ButtonBorderVariant.dirty : ButtonBorderVariant.black}
                    variantBorder={ButtonBorderVariant.black}
                    variantText={ButtonTextVariant.black}
                    height={55}
                    width={207}
                />
            </div>
        </div>
    );
};

export default UsefulButtons;
